import { Row, Col } from 'antd';

import './MainBanner.scss';


export default function MainBanner() {
    return (
        <div className='main-banner'>
            <div className='main-banner__dark' />
            <Row>
                <Col lg={4} />
                <Col lg={16}>
                    <h2>Aprende nuevas <br/></h2>
                </Col>
                <Col lg={4} />
            </Row>
        </div>
    )
}
